{
  "translationLines": [
    {
      "lineNumber": 214332,
      "originalJapaneseLine": "　絶対に犯罪なんかするような奴じゃないって、",
      "translatedEnglishLine": "They said he's definitely not the kind of person to commit a crime,"
    },
    {
      "lineNumber": 214333,
      "originalJapaneseLine": "　そんな話ばかり聞くから、何かあるなって」",
      "translatedEnglishLine": "Because I kept hearing stories like that, I thought something must be going on.\""
    },
    {
      "lineNumber": 214334,
      "originalJapaneseLine": "「それで失礼だと思ったけど、",
      "translatedEnglishLine": "\"So, I thought it might be rude, but"
    },
    {
      "lineNumber": 214335,
      "originalJapaneseLine": "　身辺調査をしたら、お母様のことを知って……」",
      "translatedEnglishLine": "after investigating, I learned about your mother...\""
    },
    {
      "lineNumber": 214336,
      "originalJapaneseLine": "「あのお医者さんね……",
      "translatedEnglishLine": "\"That doctor... you know..."
    },
    {
      "lineNumber": 214337,
      "originalJapaneseLine": "　界隈では有名な人なの……",
      "translatedEnglishLine": "He's famous in certain circles..."
    },
    {
      "lineNumber": 214338,
      "originalJapaneseLine": "　悪徳で法外な値段をふっかけるって」",
      "translatedEnglishLine": "He's notorious for being unscrupulous and charging outrageous prices.\""
    },
    {
      "lineNumber": 214339,
      "originalJapaneseLine": "「そ、そんな……」",
      "translatedEnglishLine": "\"Th-that's impossible...\""
    },
    {
      "lineNumber": 214340,
      "originalJapaneseLine": "「その分、非合法な人でも診られる、",
      "translatedEnglishLine": "\"On the other hand, he treats even illegal people,"
    },
    {
      "lineNumber": 214341,
      "originalJapaneseLine": "　イリーガルなお医者さんとして需要もあるから、",
      "translatedEnglishLine": "so there's demand for him as an illegal doctor,"
    },
    {
      "lineNumber": 214342,
      "originalJapaneseLine": "　必要悪なところもあるんだけど……」",
      "translatedEnglishLine": "so he's kind of a necessary evil...\""
    },
    {
      "lineNumber": 214343,
      "originalJapaneseLine": "「いや、だから……とにかく！」",
      "translatedEnglishLine": "\"No, that's why... anyway!\""
    },
    {
      "lineNumber": 214344,
      "originalJapaneseLine": "「……ごめんなさい！",
      "translatedEnglishLine": "\"...I'm sorry!"
    },
    {
      "lineNumber": 214345,
      "originalJapaneseLine": "　今回、バイタルさんが騙されたのは、",
      "translatedEnglishLine": "This time, Vital-san was deceived because of me!"
    },
    {
      "lineNumber": 214346,
      "originalJapaneseLine": "　私のせいでもあるの！」",
      "translatedEnglishLine": "It's also my fault!\""
    },
    {
      "lineNumber": 214347,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 214348,
      "originalJapaneseLine": "バイタルは怒っているというより、",
      "translatedEnglishLine": "Rather than being angry, Vital was"
    },
    {
      "lineNumber": 214349,
      "originalJapaneseLine": "唖然と言葉を失っていた。",
      "translatedEnglishLine": "stunned and lost for words."
    },
    {
      "lineNumber": 214350,
      "originalJapaneseLine": "「お母様なら今は別のお医者様……",
      "translatedEnglishLine": "\"Your mother is now seeing another doctor..."
    },
    {
      "lineNumber": 214351,
      "originalJapaneseLine": "　こっちはちゃんとした方ね。",
      "translatedEnglishLine": "This one is a reputable one."
    },
    {
      "lineNumber": 214352,
      "originalJapaneseLine": "　に、診て貰ってるから安心して」",
      "translatedEnglishLine": "She's getting proper treatment, so don't worry.\""
    },
    {
      "lineNumber": 214353,
      "originalJapaneseLine": "「手術も必要なく、",
      "translatedEnglishLine": "\"No surgery is necessary,"
    },
    {
      "lineNumber": 214354,
      "originalJapaneseLine": "　投薬治療で充分治るって」",
      "translatedEnglishLine": "she can be fully cured with medication.\""
    },
    {
      "lineNumber": 214355,
      "originalJapaneseLine": "「そ、それじゃ……",
      "translatedEnglishLine": "\"Th-then..."
    },
    {
      "lineNumber": 214356,
      "originalJapaneseLine": "　母は治るんですか？」",
      "translatedEnglishLine": "will my mother get better?\""
    },
    {
      "lineNumber": 214357,
      "originalJapaneseLine": "「うん、大丈夫」",
      "translatedEnglishLine": "\"Yeah, she will be fine.\""
    },
    {
      "lineNumber": 214358,
      "originalJapaneseLine": "「そう、ですか……」",
      "translatedEnglishLine": "\"Is that so...\""
    },
    {
      "lineNumber": 214359,
      "originalJapaneseLine": "「ああ……」",
      "translatedEnglishLine": "\"Ah...\""
    },
    {
      "lineNumber": 214360,
      "originalJapaneseLine": "「良かった……」",
      "translatedEnglishLine": "\"That's a relief...\""
    },
    {
      "lineNumber": 214361,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 214362,
      "originalJapaneseLine": "「馬鹿者が……」",
      "translatedEnglishLine": "\"You fool...\""
    },
    {
      "lineNumber": 214363,
      "originalJapaneseLine": "「ほ、本当にありがとうございます……っ」",
      "translatedEnglishLine": "\"Th-thank you so much...!\""
    },
    {
      "lineNumber": 214364,
      "originalJapaneseLine": "「うぅん、私はただ紹介しただけで……",
      "translatedEnglishLine": "\"No, I just introduced you to him..."
    },
    {
      "lineNumber": 214365,
      "originalJapaneseLine": "　大したことはなにも……」",
      "translatedEnglishLine": "I didn't do anything special...\""
    },
    {
      "lineNumber": 214366,
      "originalJapaneseLine": "「……いえ」",
      "translatedEnglishLine": "\"...No.\""
    },
    {
      "lineNumber": 214367,
      "originalJapaneseLine": "「これで心残りはなくなりました。",
      "translatedEnglishLine": "\"Now I have no regrets."
    },
    {
      "lineNumber": 214368,
      "originalJapaneseLine": "　安心して罪が償えます」",
      "translatedEnglishLine": "I can at last atone for my sins in peace.\""
    },
    {
      "lineNumber": 214369,
      "originalJapaneseLine": "「リセット様、本当に……",
      "translatedEnglishLine": "\"Reset-sama, truly..."
    },
    {
      "lineNumber": 214370,
      "originalJapaneseLine": "　本当にありがとうございました！」",
      "translatedEnglishLine": "Thank you very, very much!\""
    },
    {
      "lineNumber": 214371,
      "originalJapaneseLine": "バイタルは幼女相手に、",
      "translatedEnglishLine": "Against a little girl,"
    },
    {
      "lineNumber": 214372,
      "originalJapaneseLine": "臆面もなく土下座した。",
      "translatedEnglishLine": "Vital shamelessly prostrated himself."
    },
    {
      "lineNumber": 214373,
      "originalJapaneseLine": "「なにはなくとも……」",
      "translatedEnglishLine": "\"No matter what happens...\""
    },
    {
      "lineNumber": 214374,
      "originalJapaneseLine": "「まあ、これで本当に一件落着、だね」",
      "translatedEnglishLine": "\"Well, now that's really the end of this matter.\""
    },
    {
      "lineNumber": 214375,
      "originalJapaneseLine": "「あ〜、久し振りに頭使ったから、",
      "translatedEnglishLine": "\"Ahh, it's been a while since I used my brain so much,"
    },
    {
      "lineNumber": 214376,
      "originalJapaneseLine": "　疲れちゃったぁ〜」",
      "translatedEnglishLine": "I'm really tired now~\""
    },
    {
      "lineNumber": 214377,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 214378,
      "originalJapaneseLine": "「え……」",
      "translatedEnglishLine": "\"Eh...?\""
    },
    {
      "lineNumber": 214379,
      "originalJapaneseLine": "「おい、ちょっと、おっさん。",
      "translatedEnglishLine": "\"Hey, wait a minute, old man."
    },
    {
      "lineNumber": 214380,
      "originalJapaneseLine": "　あんた、今なんて言った？」",
      "translatedEnglishLine": "What exactly did you just say?\""
    },
    {
      "lineNumber": 214381,
      "originalJapaneseLine": "「え？　リセット様、本当にありがとう、と……」",
      "translatedEnglishLine": "\"Huh? ‘Thank you very much, Reset-sama’, you said...\""
    },
    {
      "lineNumber": 214382,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 214383,
      "originalJapaneseLine": "「ええええ！？　リセット！？」",
      "translatedEnglishLine": "\"Whaaaat!? Reset!?\""
    },
    {
      "lineNumber": 214384,
      "originalJapaneseLine": "「じゃあ、まさか、リセット・カラーって！」",
      "translatedEnglishLine": "\"Then, could it be... Reset Color!?\""
    },
    {
      "lineNumber": 214385,
      "originalJapaneseLine": "「あ……変なところでバレちゃった……」",
      "translatedEnglishLine": "\"Ah... I got found out at a weird moment...\""
    },
    {
      "lineNumber": 214386,
      "originalJapaneseLine": "「こほん……」",
      "translatedEnglishLine": "\"Ahem...\""
    },
    {
      "lineNumber": 214387,
      "originalJapaneseLine": "ローブの少女――あらため、",
      "translatedEnglishLine": "The girl in the robe—rather,"
    },
    {
      "lineNumber": 214388,
      "originalJapaneseLine": "リセットがあなたの前にちょこんと立つ。",
      "translatedEnglishLine": "Reset stands quietly in front of you."
    },
    {
      "lineNumber": 214389,
      "originalJapaneseLine": "「それじゃあ……最後に残った謎……",
      "translatedEnglishLine": "\"Well then... the final remaining mystery..."
    },
    {
      "lineNumber": 214390,
      "originalJapaneseLine": "　その種明かしをしましょうか」",
      "translatedEnglishLine": "Shall I reveal the trick behind it?\""
    },
    {
      "lineNumber": 214391,
      "originalJapaneseLine": "「あるときは謎のローブの少女、",
      "translatedEnglishLine": "\"At times, a mysterious girl in a robe,"
    }
  ]
}

